import React from 'react';

const LoginCerberus = () => {
  let intro = {
    svg: '/logo/Cerberus_logo.svg',
    name: 'cerberus'
  };

  return (
    <div className="login">
      <div className="intro">
        img
      </div>
      <form id="login"></form>
    </div> 
    );
}

export default LoginCerberus;
